import React from "react";
import SectionHeader from "./sub-components/SectionHeader";

const Education = () => (
  <section id="education">
    <SectionHeader sectionHeader="Education" />
    <div className="education-section">
      <div className="education-card card">
        <div className="degree-title">B.S. Computer Science</div>
        <div className="eductaion-body">Oregon State University</div>
      </div>
      <div className="education-card card">
        <div className="degree-title">B.S. Biology</div>
        <div className="education-body">Roosevelt University</div>
      </div>
    </div>
  </section>
);

export default Education;
